import './welcome_page.css';

function WelcomePage() {
  return (
    <div className="WelcomePage">
      <p>
        Welcome !
      </p>
      <p>You can navigate to the <a href="/form">portfolio form</a> and to the <a href="/summary">portfolio summary</a></p>
    </div >
  );
}

export default WelcomePage;
